'use strict';
let HeartbeatFxmsgReader = require('./HeartbeatFxmsgReader.js');
let TradingHeartbeatMessageBulder = require('./TradingHeartbeatMessageBulder.js');
class TradingHeartbeatFxmsgReader extends HeartbeatFxmsgReader {
    createMessage(numSubscribedSymbolsStr, subscribedSymbolsCheckSum, requestId) {
        let messageBuilder;
        messageBuilder = new TradingHeartbeatMessageBulder();
        messageBuilder.setRequestId(requestId);
        messageBuilder.setNumberOfSubscribedSymbols(numSubscribedSymbolsStr);
        messageBuilder.setSubscribedSymbolsCheckSum(subscribedSymbolsCheckSum);
        return messageBuilder.build();
    }
}
module.exports = TradingHeartbeatFxmsgReader
